import React from "react";

import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

import routes from "./routes";
import Home from "./pages";

export default function App() {
  return (
    <Router>
      <Route exact path="/" component={Home} />
      <Route />
    </Router>
  );
}
